import React from "react";

const LeftInfo = ({ isProfileData }) => {
  const leftProfileData = isProfileData?.profile[0];
  return (
    <React.Fragment>
      <div className="block">
        <p className="font-xs">
          <span>Name</span>:{leftProfileData?.firstName}
        </p>
      </div>
    </React.Fragment>
  );
};

export default LeftInfo;
